import React, { useState } from "react";
import {
  Home,
  Search,
  FileText,
  Globe,
  Users,
  Settings,
  HelpCircle,
} from "lucide-react";

const Dashboard = () => {
  const [isExpanded, setIsExpanded] = useState(false);

  const navItems = [
    { icon: Home, label: "Home", path: "/" },
    { icon: Search, label: "Search", path: "/search" },
    { icon: FileText, label: "Documents", path: "/documents" },
    { icon: Globe, label: "World", path: "/world" },
    { icon: Users, label: "Community", path: "/community" },
    { icon: Settings, label: "Settings", path: "/settings" },
    { icon: HelpCircle, label: "Help", path: "/help" },
  ];

  return (
    <div className="flex h-screen bg-gray-50">
      {/* Sidebar */}
      <aside
        className={`bg-white shadow-sm transition-all duration-300 ${
          isExpanded ? "w-64" : "w-16"
        }`}
      >
        <div className="h-16 flex items-center justify-center">
          <button
            onClick={() => setIsExpanded(!isExpanded)}
            className="p-2 hover:bg-gray-200 rounded-lg"
          >
            {/* Toggle Button */}
            {isExpanded ? "<" : ">"}
          </button>
        </div>

        <nav className="mt-4">
          {navItems.map((item, index) => (
            <a
              key={index}
              href={item.path}
              className="flex items-center gap-4 px-4 py-3 hover:bg-gray-100 transition-colors"
            >
              {/* Icon */}
              <item.icon className="text-gray-600" />
              {/* Label */}
              {isExpanded && <span className="text-gray-700">{item.label}</span>}
            </a>
          ))}
        </nav>
      </aside>

      {/* Main Content */}
      <main
        className={`flex-grow transition-all duration-300 ${
          isExpanded ? "ml-64" : "ml-16"
        } p-6`}
      >
        <header className="mb-6">
          <h1 className="text-2xl font-bold">Hi, Richard Pokhrel!</h1>
          <p className="text-gray-600">
            Welcome back, we're happy to have you here!
          </p>
        </header>

        <section>
          <div className="bg-white rounded-lg shadow p-4 mb-6">
            <h2 className="text-lg font-bold">Your Account</h2>
            <p>Your Account is currently Pending. More Info...</p>
          </div>

          <div className="grid grid-cols-2 gap-4">
            <div className="bg-white rounded-lg shadow p-4">
              <h3 className="text-xl font-bold">Applications Submitted</h3>
              <p>0 Applications Submitted</p>
            </div>
            <div className="bg-white rounded-lg shadow p-4">
              <h3 className="text-xl font-bold">Priority Tasks</h3>
              <p>Complete your tasks to move forward.</p>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Dashboard;
